import React from "react";

class Navbar extends React.Component {
  render() {
    return (
      <div>
        <a href="/">
          <img src={logo} alt="Logo" />
          <span>Platzi</span>
          <span>Conf</span>
        </a>
      </div>
    );
  }
}

export default Navbar;
